import { boxes } from "./Boxes";
import React from 'react';

export default function Practice() {
  const [arrayOfBoxes, setArrayOfBoxes] = React.useState(boxes);
  const jsxBoxes = arrayOfBoxes.map(box => <p key={box.id} style={{ border: '1px solid black', height: '100px', width: '100px', background: 'papayawhip' }}></p>);

  return (
    <div>
        { jsxBoxes }
    </div>
  );
};
